This app is a white blood cell differential counter calculator. In this app you can count and calculate erythrocytes and leukocytes for Urine exams, cerebrospinal, liquid ascitic, pleural and others biological fluids. This app is target for health sciences students, medical laboratory technologists and medical laboratory assistants.

-Touch in the buttons on screen to start counting and calculate blood cells while you are using your microscope;
-Count differential white blood cells;
-Count erytrocytes and leukocytes for Urine exams, cerebrospinal (CSF), ascitic or pleural fluids. 
-When you finish to count 100 cells, the app will show you an alert in the end. ---For every touch in bottons the app emits sounds and vibrate to help you in your count.

This app is free. Its support and development is provided through advertisements.

