Health Measure Graph is a simple and easy-to-use application developed with the aim of allowing each user to monitor their health state.

With this health control app you can:

-  take daily measurements of general body temperature, basal body temperature, pulse, blood pressure, blood sugar, weight and height;

-  on data accumulation build schedules and monitor the dynamics of change;

-  keep the results of laboratory tests of urine and blood in a standardized form with the boundary indicators;

-  set your current weight and specify a goal for reaching the desired weight;

-  calculate the body mass index (BMI).

In the application there is a possibility of selecting measurement units for temperature, weight, height, etc., as well as automatically converting data, that has been already entered.

Install Health Measure Graph and make sure that health monitoring is possible without the help of doctors!

